//获取省对象
function getProvObj(code){ //字符串
    let obj={}
    areaCodeArr.forEach(function(prov){
        if(prov.code==code){
            obj=prov
        }
    })
    return obj
}
//获取市对象
function getCityObj(code){
    let obj={}
    areaCodeArr.forEach(function(prov){
        if(prov.sub){
            prov.sub.forEach(function(city){
                if(city.code==code){
                    obj=city
                }
            })
        }
    })
    return obj
}